
/**
 * QueueNodeInterface
 * 
 * QueueNodeInterface defines the operations of a Queue node.
 */

export interface QueueNodeInterface<T> {

    /**
     * next()
     * 
     * next() gets the next node.
     */

    next(): QueueNodeInterface<T>|null;

    /**
     * value()
     * 
     * value() gets the value of the node.
     */
    value(): T;
}